import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => <div>{<i className="text-primary fas fa-map-marker-alt fa-3x"></i>}</div>;

class Maps extends Component {
  static defaultProps = {
    center: {
      lng: 72.89,
      lat: 19.04
    },
    zoom: 1
  };


  render() {

    let centersLocation = JSON.parse(localStorage.getItem("centres"));
    // console.log(centersLocation);

    let array = [1, 2, 3]

    return (
      // Important! Always set the container height explicitly
      <div style={{ height: '520px', width: '100%' }}>
        <GoogleMapReact
          bootstrapURLKeys={{ key:"AIzaSyCIJkPLyzo5XZODdhxAa_XYbk2ESQpJyZw"}}
          defaultCenter={this.props.center}
          defaultZoom={this.props.zoom}
        >
          {

            array.forEach(item => {
              <AnyReactComponent
                lng={item[1].lng}
                lat={item[1].lat}
                text="My Marker"
              />
            })
          }


          {Object.entries(centersLocation.data).map((item,k) => {
            console.log(item[1].lng);
              <AnyReactComponent
                lng={item[1].lng}
                lat={item[1].lat}
                text="My Marker"
              />
          })
        }

        </GoogleMapReact>
      </div>
    );
  }
}

export default Maps;
